    function removeElement(address element, address[] storage arr) private returns(address[] memory){
        for(uint i = 0; i<arr.length; i++){
            if(arr[i] == element){
                arr[i] = arr[arr.length-1];
                arr.pop();
            }
        }
        return arr;
    }

